export enum DocumentType{
  AFFIDAVIT,
  CONSENT_LETTER,
  INDEMNITY_BOND,
  AGREEMENT,
  SALE_DEED,
  GIFT_DEED,
  RELEASE_DEED,
  POWER_OF_ATTORNEY
}

export enum DocumentTypeKeyWordId{
  AFFIDAVIT         = 65,
  CONSENT_LETTER    = 66,
  INDEMNITY_BOND    = 67,
  AGREEMENT         = 68,
  SALE_DEED         = 69,
  GIFT_DEED         = 70,
  RELEASE_DEED      = 71,
  POWER_OF_ATTORNEY = 72
}

export class Draft{
  private _name:string                 = "New document";
  private _documentType:DocumentType   = DocumentType.AFFIDAVIT;
  private _pages:Page[]                = [];
  private _language:Language           = Account.instance.language;

  constructor(name?:string, documentType?:DocumentType, pages?:Page[], language?:Language){
    if(!!name)          this._name          = name;
    if(!!documentType)  this._documentType  = documentType;
    if(!!pages)         this._pages         = pages;
    if(!!language)      this._language      = language;
  }

  get name():string{
    return this._name
  }

  get documentType():DocumentType{
    return this._documentType;
  }

  get pages():Page[]{
    return this._pages;
  }

  get language():Language{
    return this._language;
  }

  setName(name:string):void{
    this._name = name;
  }

  setDocumentType(documentType:DocumentType):void{
    this._documentType = documentType;
  }

  setPages(pages:Page[]):void{
    this._pages = pages;
  }

  setLanguage(language:Language):void{
    this._language = language;
  }
}

